import RENTAL_DATA from "./rental.data";

const INITIAL_STATE = {
  rentals: RENTAL_DATA,
};

const rentalReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default rentalReducer;
